import React from 'react';
import { Students } from './data';
import Student from './Student';

const Team = () => {
  return (
    <>
    <div className="container">
        <div className="row">
            {

            Students.map( (student, index)=> 
            <Student name={student.name}  skill={student.skill} photo={student.photo} />
            
            )
            }
        </div>
    </div>
    
    </>
  )
}

export default Team
